function checkDate(inputDate) {
    if(inputDate === null){
      return false
    }
    // Get today's date in UTC
    var todayUTC = new Date();
    $input.item.json.test = todayUTC.getTime();
    // Convert UTC to Adelaide time
    var adelaideTimeOffset = 10.5 * 60 * 60 * 1000; // Adelaide time offset in milliseconds (10.5 hours ahead of UTC)
    $input.item.json.adelaideOffset = adelaideTimeOffset
    var adelaideTime = new Date(todayUTC.getTime() + adelaideTimeOffset);

    // Format Adelaide date
    var dd = String(adelaideTime.getUTCDate());
    var mm = String(adelaideTime.getUTCMonth()+1);//dates arre zero  indexed


    const inputSplit = inputDate.split("-");
    $input.item.json.dd = dd
    $input.item.json.mm = mm
    $input.item.json.split_dd = parseInt(inputSplit[inputSplit.length - 1])
    $input.item.json.split_mm = parseInt(inputSplit[inputSplit.length - 2])

    // Check if input date matches Adelaide's date
    if (parseInt(inputSplit[inputSplit.length - 1]) === parseInt(dd) && parseInt(inputSplit[inputSplit.length - 2]) === parseInt(mm)) {
        return true;
    } else {
        return false;
    }
}

$input.item.json.isBirthday = checkDate($input.item.json.data.birthdate);
// $input.item.json.isBirthday = $input.item.json.data.birthdate ;
return $input.item;

